;; Take n samples from the query for ith member.
(defn sample [query i n]
  (let [data (vote-ith i)]
    (map :result (take n (take-nth 50 (drop 1000 (doquery :lmh query [data])))))))

;; Plot the samples.
(defn sample-plot [samples]
  (plot/histogram samples :bins 50 :normalise :probability))

;; Return the Sample Mean.
(defn sample-mean [samples]
  (/ (reduce + 0.0 samples) (count samples)))
