;; @@
;; Independence Assumption, Batch Update for Beta Distribution.
(defquery ind-bat [data]
    (let [a (+ 1 (sample (poisson 1)))		; to make prior similar to uniform distribution.
          b (+ 1 (sample (poisson 1)))
          freq (reduce + 0 data)		; frequency of same vote
          len (count data)				; number of samples
          prob (/ freq len)]			; expected prob. for same vote in the next vote.
      (observe (beta a b) prob)		; the probability comes from beta distribution.
      (sample (beta a b))))			; latent for posterior inference.
