(defn dot-prod [v1 v2]
  (let [l1 (count v1)
        l2 (count v2)]
    (if (not (= l1 l2))
      (println "Fail: Two vectors are in different dimension!")
      (reduce + 0.0 (map (fn [x y] (* x y)) v1 v2)))))

(defn cos-sim [v1 v2]
  (let [l (count v1)]
    (/ (dot-prod v1 v2) l)))
