    (filter (fn [y] (or (> (second y) 0.9) (< (second y) 0.3)))
        	(map (fn [x] (list x (cos-sim (vote-ith x) (vote-ith key-idx))))
            	 (range 0 (count members))))))

(dotimes [i (count extremes)]
  (println (nth extremes i)))
