(defn sample-prob-ip [i n]
  (let [data (vote-ith i)
        freq (reduce + 0 data)
        len (count data)
        prob (/ freq len)]
    (map :result (take n (take-nth 50 (drop 1000 (doquery :ipmcmc ind-bat-opt [prob])))))))
